function point(x,y,w,c){
if(window.canvas_u){
canvas_c.fillStyle=canvas_col[c];
canvas_c.fillRect(x-w/2,y-w/2,w,w);
return;}
var e=document.createElement(c);
canvas.appendChild(e);
var s=e.style;
h=w/2;
s.width=w;
s.height=w;
s.left=x-h;
s.top=y-h;}

function line(x,y,x2,y2,s,w,c){
if(window.canvas_u){
canvas_c.strokeStyle=canvas_col[c];
canvas_c.beginPath();if(w==3){
var tx,ty,tr,t,i,j,x_=x,y_=y,t_=.2,t2=.1;
tx=x2-x;ty=y2-y;tr=Math.sqrt(tx*tx+ty*ty);
tx/=tr;ty/=tr;tr-=3;
for(i=-t_;i<=t_;i+=t2)for(j=-t_;j<=t_;j+=t2){
t=0;x=i+x_;y=j+y_;
while(t<tr){t+=5;
canvas_c.moveTo(x,y);
canvas_c.lineTo(x+tx*2,y+ty*2);
x+=tx*5;y+=ty*5;
if(t>=tr)break;t+=3;
canvas_c.moveTo(x,y);
canvas_c.lineTo(x+tx*3,y+ty*3);
x+=tx*3;y+=ty*3;}}
canvas_c.stroke();return;
}else{
var i,j,t_=.1,t2=.05;
if(w>3){t_=1;t2=.5;}
for(i=-t_;i<=t_;i+=t2)for(j=-t_;j<=t_;j+=t2){
canvas_c.moveTo(x+i,y+j);
canvas_c.lineTo(x2+i,y2+j);
}}
canvas_c.stroke();if(w<3)return;
canvas_c.stroke();
return;}
var x0=(x2-x);
var y0=(y2-y);
var h=Math.sqrt(x0*x0+y0*y0);
x0=x0/h*s;
y0=y0/h*s;
var i=0;
var j=h/s;
while(i<=j){
point(x,y,w,c);
x+=x0;
y+=y0;
i++;}}

