function crc32(s){s=String(s);
var r,i,j,c,FF=0xFFFFFFFF;r=FF;
for(i=0;i<s.length;i++){c=s.charCodeAt(i)&255;
r=(((((r/256))^crctable[((r%256))^c]))>>>0);}
r=(((r^FF))>>>0).toString(16);
while(r.length<8)r="0"+r;return r;}
function crcreverse(x,n){
var b=0;while(n){
b=b*2+x%2;x/=2;x-=x%1;
n--;}return b}
crctable=[];
for(i=255;i>=0;i--){c=crcreverse(i,32);
for(j=0;j<8;j++){c=((c*2)^(((c>>>31)%2)*0x04C11DB7))>>>0;}
crctable[i]=crcreverse(c,32);}

function base64_encode(str)
 {
 var res = '';
 var c1, c2, c3, e1, e2, e3, e4;
 var key = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";
 var i = 0;

 while(i < str.length)
 {
 c1 = str.charCodeAt(i++);
 c2 = str.charCodeAt(i++);
 c3 = str.charCodeAt(i++);

 e1 = c1 >> 2;
 e2 = ((c1 & 3) << 4) | (c2 >> 4);
 e3 = ((c2 & 15) << 2) | (c3 >> 6);
 e4 = c3 & 63;

 if(isNaN(c2))
 {
 e3 = e4 = 64;
 }
 else if(isNaN(c3))
 {
 e4 = 64;
 }

 res += key.charAt(e1) + key.charAt(e2) + key.charAt(e3) + key.charAt(e4);
 }

 return res;
 }

function base64_decode (text)
 {
 var key="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/="
 var res = '';
 var c1, c2, c3, e1, e2, e3, e4;
 var i = 0;

 text = text.replace(/[^A-Za-z0-9\+\/\=]/g, '');

 while(i < text.length)
 {
 e1 = key.indexOf(text.charAt(i++));
 e2 = key.indexOf(text.charAt(i++));
 e3 = key.indexOf(text.charAt(i++));
 e4 = key.indexOf(text.charAt(i++));

 c1 = (e1 << 2) | (e2 >> 4);
 c2 = ((e2 & 15) << 4) | (e3 >> 2);
 c3 = ((e3 & 3) << 6) | e4;

 res += String.fromCharCode(c1);

 if(e3 != 64)
 res += String.fromCharCode(c2);
 if(e4 != 64)
 res += String.fromCharCode(c3);
 }

 return res;
 }

function swap8(s,r){
var i,j,t,a=s.split('');
if(r==2)a.reverse();
for(i=0;i<8;i++){
j=8+i*2;t=a[j];
a[j]=a[i];a[i]=t;
}if(r==1)a.reverse();
return a.join('')}

